    false,nt"url": null,nt"notes": "This narrative report for Montezuma National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1948.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include haying. The public relations section of the
    report describes recreational uses, Refuge visitors, and Refuge participation. Photographs
    and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
